import React from "react"

function ManageDetailsView(props) {

    return (
        <div>
            <table className="table">
                <thead>
                    <tr>
                        <th>&nbsp;</th>
                        <th>Name</th>
                        <th>Address</th>
                        <th>Category</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        <tr key="1">
                            <td>Alice</td>
                            {props.details['alice'].map(child => {
                                console.log(child)
                            })}
                            <td>{props.details['alice']['id']}</td>
                            <td>{props.details['alice']['cash']}</td>
                            <td>{props.details['alice']['waitForInput']}</td>
                        </tr>
                    }
                </tbody>
            </table>
        </div>
    )
}

export default ManageDetailsView;
